    public static String executeJarAndGetPid() throws IOException, InterruptedException {
        String javaExecutablePath = System.getProperty("java.home") + File.separator + "bin" + File.separator + "java";
        String command = javaExecutablePath + " -jar " + JAR_PATH;
        Process process = Runtime.getRuntime().exec(command);
        XxlJobLogger.log("Executing command: " + command);

        BufferedReader reader = new BufferedReader(new InputStreamReader(process.getInputStream()));
        String line;
        Pattern pattern = Pattern.compile("\\[\\*\\] Found pid (\\d+) [^\\[]*\\[com.xxl.job.admin.XxlJobAdminApplication\\]");
        String pid = null;
        try {
            while ((line = reader.readLine()) != null) {
                XxlJobLogger.log(line);
                Matcher matcher = pattern.matcher(line);
                if (matcher.find()) {
                    pid = matcher.group(1);
                    break;
                }
            }
        } finally {
            reader.close();
        }
        process.waitFor();
        return pid;
    }

    public static void executeJarWithPid(String pid) throws IOException, InterruptedException {
        String javaExecutablePath = System.getProperty("java.home") + File.separator + "bin" + File.separator + "java";
        String command = javaExecutablePath + " -jar " + JAR_PATH + " " + pid;
        Process process = Runtime.getRuntime().exec(command);
        XxlJobLogger.log("Executing command with PID: " + command);

        BufferedReader reader = new BufferedReader(new InputStreamReader(process.getInputStream()));
        try {
            String line;
            while ((line = reader.readLine()) != null) {
                XxlJobLogger.log(line);
            }
        } finally {
            reader.close();
        }
        int exitVal = process.waitFor();
        if (exitVal == 0) {
            XxlJobLogger.log("Command executed successfully with PID:" + pid);
        } else {
            XxlJobLogger.log("Command execution failed with exit code " + exitVal);
        }
    }
